class Solution {
    public int minimumIndex(List<Integer> nums) {
        int n = nums.size();
        Map<Integer, Integer> freq = new HashMap<>();
        int dominant = nums.get(0), maxFreq = 1;
        freq.put(dominant, 1);
        for (int i = 1; i < n; ++i) {
            freq.put(nums.get(i), freq.getOrDefault(nums.get(i), 0) + 1);
            if (freq.get(nums.get(i)) > maxFreq) {
                dominant = nums.get(i);
                maxFreq = freq.get(nums.get(i));
            }
        }
        if (maxFreq * 2 <= n) return -1;
        int leftFreq = 0, rightFreq = maxFreq;
        for (int i = 0; i < n - 1; ++i) {
            if (nums.get(i) == dominant) {
                leftFreq++;
                rightFreq--;
            }
            if (leftFreq * 2 > i + 1 && rightFreq * 2 > n - i - 1) {
                return i;
            }
        }
        return -1;
    }
}
